("Onigiri","Namiko Hirasawa Chen","2 cups uncooked Japanese short-grain rice
2 1/2 cups Water
kosher/sea salt (I use Diamond Crystal; Use half for table salt)
4 sheets nori (seaweed)
Salted salmon (recipe follows)
Okaka (recipe follows)
Tuna Mayo (recipe follows)
3 umeboshi (Japanese pickled plum) (purchased)
seasoned kombu (purchased)
toasted white and black sesame seeds (to garnish)
1 fillet salmon
kosher/sea salt (I use Diamond Crystal; Use half for table salt)
2 packages Katsuobushi (dried bonito flakes) (2 packages = 6 g)
2 Tbsp soy sauce
1 canned tuna (2.5 oz = 70 g)
2 Tbsp Japanese mayonnaise
1/2 Tbsp soy sauce","Rice
1. Put the rice in a large bowl and gently wash the rice in a circular motion and discard the water. Repeat this process about 3-4 times.
2. Let the rice soak in water for 30 minutes. Transfer the rice into a sieve and drain completely, at least 15 minutes.
3. Combine the rice and water in a heavy-bottom pot (See Notes). Cover the lid and bring it to a boil over medium heat. 
4. Once water is boiling, turn the heat to the lowest setting and continue to cook covered for 12 to 13 minutes, or until the water is completely absorbed. At 12-13 minute mark, take a quick peek and if you see there is any water left, close the lid and continue cooking for another minute or so.
5. Remove the pot (with the lid on) from the heat and let it steam for another 10 minutes. Then transfer the rice to a large plate (I use Sushi Oke). Fluff the rice with a rice scooper. Let the cooked rice cool a little bit until you can hold rice without burning your hands. However, do not let the rice completely cool down.

Onigiri Fillings
1. While rice is being soaked and drained (45 minutes), prepare the onigiri fillings.
Salted salmon filling: Sprinkle kosher salt on both sides of the salmon fillet. Bake at 400 ºF (200 ºC) degrees in a toaster oven or oven for 25 minutes.
2. Break the cooked salmon into flakes and set aside.
3. Umeboshi filling: Place umeboshi (Japanese pickled plums) on a 10” x 10” sheet of plastic wrap. Fold in half and squeeze the seed out from each umeboshi. Discard the seeds and keep the umeboshi flesh.
4. Okaka filling: Put katsuobushi (dried bonito flakes) in a bowl and add 2 Tbsp soy sauce. Mix to combine. Katsuobushi should be moisten but soy sauce should not be left at the bottom of the bowl.
5. Tuna mayo filling: Put drained canned tuna in a bowl and add 2 Tbsp Japanese mayonnaise and ½ Tbsp soy sauce. Mix to combine.
6. Seasoned kombu filling: Put the purchased seasoned kombu in a bowl for easy access later.

Onigiri
1. Cut the nori sheets in thirds (1/3).
2. First, wet both of your hands with water in order to prevent the rice from sticking to your hands.
3. Then put some salt in your hands and rub to spread all around your palms. How much salt? I dip 3 finger tips in kosher salt shown in the picture below. If you are using table salt, use half amount as it’s saltier than kosher salt.
4. Scoop out a handful of warm rice (about 1/3 cup) into one hand. Create a small well (indentation) in the center of the rice. Put one kind of fillings (about 1-2 tsp.) inside. Then mold the rice with your hands around the well to cover your filling completely.
5. Press the rice around the filling to gently form the rice into a triangle. I use three fingers (thumb, index finger, middle finger) to make a triangle corner. Your hands should be just firm enough so the onigiri doesn't fall apart. You don't want to squeeze the rice too tight.
6. Wrap the onigiri with nori (seaweed).
7. Place a little bit of each filling on top of onigiri so we know which kind it is.",
